import './App.css';

import Router from './routers/Router';

function App() {
  return (
    <div>
      <main className='main'>
        <Switch>
          <Route exact path='/'>
            <Header />
            <Form inputTitle={inputTitle} setInputTitle={setInputTitle} input={input} setInput={setInput} todos={todos} setTodos={setTodos} />
            <TodoList todos={todos} setTodos={setTodos} />
          </Route>
          <Route path='/:id'>
            <Details todos={todos} />
          </Route>
        </Switch>
      </main>
    </div>
  );
}

export default App;
